bool M68k::IsOpcode(word opcode, std::string mask)
{
	for(int i = 0; i < 16; i++)
	{
		char bit = '0' + BitGetVal(opcode, 15-i);

		if(mask[i] == 'x')
		{
			continue;
		}

		if(mask[i] != bit)
		{
			return false;
		}
	}

	return true;
}

