void M68k::OpcodeNBCD(word opcode)
{
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	byte dest = (byte)get().GetEAOperand(type, eaReg, BYTE, true, 0).operand;

	byte xflag = TestBit(get().CCR, X_FLAG);

	dest += xflag;

	//BCD OVERFLOW CORRECTION
	if((dest & 0xF) > 9)
	{
		dest -= 0x6;
	}

	if((dest >> 4) > 9)
	{
		dest -= 0x60;
	}

	if(dest != 0)
	{
		dest--;
		BitSet(get().CCR, C_FLAG);
		BitSet(get().CCR, X_FLAG);
	}
	else
	{
		BitReset(get().CCR, C_FLAG);
		BitReset(get().CCR, X_FLAG);
	}

	word result = 0x99 - dest;

	EA_DATA set = SetEAOperand(type, eaReg, (byte)result, BYTE, 0);

	if((result & 0xFF) != 0)
	{
		BitReset(get().CCR, Z_FLAG);
	}

	switch(type)
	{
		case EA_DATA_REG:
		case EA_ADDRESS_REG:
		get().opcodeClicks += 4;
		break;

		default:
		get().opcodeClicks += 8;
		get().opcodeClicks += set.cycles;
		break;
	}
}

void M68k::OpcodeNEG(word opcode)
{
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	EA_DATA data = get().GetEAOperand(type, eaReg, size, true, 0);

	switch(type)
	{
		case EA_DATA_REG:
		case EA_ADDRESS_REG:
		get().opcodeClicks += (size == LONG) ? 6 : 4;
		break;

		default:
		get().opcodeClicks += (size == LONG) ? 8 : 12;
		get().opcodeClicks += data.cycles;
		break;
	}

	//C_FLAG & X_FLAG
	uint64_t maxTypeSize = get().GetTypeMaxSize(size);
	uint64_t sonic = (uint64_t)0 & maxTypeSize;
	uint64_t tails = (uint64_t)data.operand & maxTypeSize;
	if(sonic < tails)
	{
		BitSet(get().CCR, C_FLAG);
		BitSet(get().CCR, X_FLAG);
	}
	else
	{
		BitReset(get().CCR, C_FLAG);
		BitReset(get().CCR, X_FLAG);
	}

	//V_FLAG
	switch(size)
	{
		case BYTE:
		{
			signed_word eggman = (signed_byte)0 - (signed_byte)data.operand;

			if(eggman < INT8_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;

		case WORD:
		{
			signed_dword eggman = (signed_word)0 - (signed_word)data.operand;

			if(eggman < INT16_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;

		case LONG:
		{
			int64_t eggman = (signed_dword)0 - (signed_dword)data.operand;

			if(eggman < INT32_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;
	}

	data.operand = 0 - data.operand;
	get().SetEAOperand(type, eaReg, data.operand, size, 0);
	get().programCounter += data.PCadvance;
	
	dword vectorman = data.operand;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}
}

void M68k::OpcodeNEGX(word opcode)
{
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	dword xflag = TestBit(get().CCR, X_FLAG);

	EA_DATA data = get().GetEAOperand(type, eaReg, size, true, 0);

	//C_FLAG & X_FLAG
	uint64_t maxTypeSize = get().GetTypeMaxSize(size);
	uint64_t sonic = (uint64_t)0 & maxTypeSize;
	uint64_t tails = (uint64_t)(data.operand + xflag) & maxTypeSize;
	if(sonic < tails)
	{
		BitSet(get().CCR, C_FLAG);
		BitSet(get().CCR, X_FLAG);
	}
	else
	{
		BitReset(get().CCR, C_FLAG);
		BitReset(get().CCR, X_FLAG);
	}

	//V_FLAG
	switch(size)
	{
		case BYTE:
		{
			signed_word eggman = (signed_byte)0 - (signed_byte)data.operand - (signed_byte)xflag;

			if(eggman < INT8_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;

		case WORD:
		{
			signed_dword eggman = (signed_word)0 - (signed_word)data.operand - (signed_word)xflag;

			if(eggman < INT16_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;

		case LONG:
		{
			int64_t eggman = (signed_dword)0 - (signed_dword)data.operand - (signed_dword)xflag;

			if(eggman < INT32_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;
	}

	data.operand = 0 - data.operand - xflag;
	EA_DATA set = get().SetEAOperand(type, eaReg, data.operand, size, 0);
	get().programCounter += data.PCadvance;

	switch(type)
	{
		case EA_DATA_REG:
		case EA_ADDRESS_REG:
		get().opcodeClicks += (size == LONG) ? 6 : 4;
		break;

		default:
		get().opcodeClicks += (size == LONG) ? 8 : 12;
		get().opcodeClicks += set.cycles;
		break;
	}
	
	dword vectorman = data.operand;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}
}

void M68k::OpcodeNOP()
{
	get().opcodeClicks += 4;
}

void M68k::OpcodeNOT(word opcode)
{
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	EA_DATA data = get().GetEAOperand(type, eaReg, size, true, 0);

	switch(type)
	{
		case EA_DATA_REG:
		case EA_ADDRESS_REG:
		get().opcodeClicks += (size == LONG) ? 6 : 4;
		break;

		default:
		get().opcodeClicks += (size == LONG) ? 8 : 12;
		get().opcodeClicks += data.cycles;
		break;
	}

	dword newData = 0;
	switch(size)
	{
		case BYTE:
		{
			byte tempData = (byte)data.operand;
			tempData = ~tempData;
			newData = tempData;
		}
		break;

		case WORD:
		{
			word tempData = (word)data.operand;
			tempData = ~tempData;
			newData = tempData;
		}
		break;

		case LONG:
		{
			dword tempData = data.operand;
			tempData = ~tempData;
			newData = tempData;
		}
		break;
	}

	get().SetEAOperand(type, eaReg, newData, size, 0);

	get().programCounter += data.PCadvance;

	//C_FLAG
	BitReset(get().CCR, C_FLAG);
	//V_FLAG
	BitReset(get().CCR, V_FLAG);

	dword vectorman = newData;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}
}

void M68k::OpcodeOR(word opcode)
{
	byte reg = (opcode >> 9) & 0x7;
	byte opmode = (opcode >> 6) & 0x7;
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	if(!TestBit(opmode, 2))
	{
		//<EA> | DN -> DN
		DATASIZE size = LONG;
		switch(opmode)
		{
			case 0:
			size = BYTE;
			break;

			case 1:
			size = WORD;
			break;

			case 2:
			size = LONG;
			break;
		}

		EA_TYPES type = (EA_TYPES)eaMode;

		EA_DATA src = get().GetEAOperand(type, eaReg, size, false, 0);
		EA_DATA dest = get().GetEAOperand(EA_DATA_REG, reg, size, true, 0);

		switch(size)
		{
			case BYTE:
			case WORD:
			get().opcodeClicks += 4;
			break;

			case LONG:
			{
				if(src.eatype == EA_DATA_REG || src.eatype == EA_ADDRESS_REG || src.mode7Type == EA_MODE_7_IMMEDIATE)
				{
					get().opcodeClicks += 8;
				}
				else
				{
					get().opcodeClicks += 6;
				}
			}
			break;
		}

		get().opcodeClicks += src.cycles;

		BitReset(get().CCR, C_FLAG);
		BitReset(get().CCR, V_FLAG);

		dword result = src.operand | dest.operand;
		dword vectorman = result;
		switch(size)
		{
			case BYTE:
			vectorman &= 0xFF;
			break;

			case WORD:
			vectorman &= 0xFFFF;
			break;

			case LONG:
			vectorman &= 0xFFFFFFFF;
			break;
		}

		//Z_FLAG
		if(vectorman == 0)
		{
			BitSet(get().CCR, Z_FLAG);
		}
		else
		{
			BitReset(get().CCR, Z_FLAG);
		}

		//N_FLAG
		int bit = 0;

		switch(size)
		{
			case BYTE:
			bit = 7;
			break;

			case WORD:
			bit = 15;
			break;

			case LONG:
			bit = 31;
			break;
		}

		if(TestBit(vectorman, bit))
		{
			BitSet(get().CCR, N_FLAG);
		}
		else
		{
			BitReset(get().CCR, N_FLAG);
		}

		get().SetEAOperand(EA_DATA_REG, reg, result, size, 0);

		get().programCounter += src.PCadvance;

	}
	else
	{
		//DN | <EA> -> <EA>
		DATASIZE size = LONG;
		switch(opmode)
		{
			case 4:
			size = BYTE;
			break;

			case 5:
			size = WORD;
			break;

			case 6:
			size = LONG;
			break;
		}

		EA_TYPES type = (EA_TYPES)eaMode;

		EA_DATA src = get().GetEAOperand(type, eaReg, size, false, 0);
		EA_DATA dest = get().GetEAOperand(EA_DATA_REG, reg, size, true, 0);

		switch(size)
		{
			case BYTE:
			case WORD:
			get().opcodeClicks += 8;
			break;

			case LONG:
			get().opcodeClicks += 12;
			break;
		}

		get().opcodeClicks += src.cycles;

		BitReset(get().CCR, C_FLAG);
		BitReset(get().CCR, V_FLAG);

		dword result = dest.operand | src.operand;

		dword vectorman = result;
		switch(size)
		{
			case BYTE:
			vectorman &= 0xFF;
			break;

			case WORD:
			vectorman &= 0xFFFF;
			break;

			case LONG:
			vectorman &= 0xFFFFFFFF;
			break;
		}

		//Z_FLAG
		if(vectorman == 0)
		{
			BitSet(get().CCR, Z_FLAG);
		}
		else
		{
			BitReset(get().CCR, Z_FLAG);
		}

		//N_FLAG
		int bit = 0;

		switch(size)
		{
			case BYTE:
			bit = 7;
			break;

			case WORD:
			bit = 15;
			break;

			case LONG:
			bit = 31;
			break;
		}

		if(TestBit(vectorman, bit))
		{
			BitSet(get().CCR, N_FLAG);
		}
		else
		{
			BitReset(get().CCR, N_FLAG);
		}

		get().SetEAOperand(type, eaReg, result, size, 0);

		get().programCounter += src.PCadvance;

	}
}

void M68k::OpcodeORI(word opcode)
{
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	EA_DATA src = get().GetEAOperand(EA_MODE_7, EA_MODE_7_IMMEDIATE, size, false, 0);
	get().programCounter += src.PCadvance;
	EA_DATA dest = get().GetEAOperand(type, eaReg, size, true, 0);
	dword result = dest.operand | src.operand;

	get().SetEAOperand(type, eaReg, result, size, 0);

	get().programCounter += dest.PCadvance;

	switch(type)
	{
		case EA_DATA_REG:
		case EA_ADDRESS_REG:
		get().opcodeClicks += (size == LONG) ? 16 : 8;
		break;

		default:
		get().opcodeClicks += (size == LONG) ? 20 : 12;
		break;
	}

	BitReset(get().CCR, C_FLAG);
	BitReset(get().CCR, V_FLAG);

	dword vectorman = result;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}
}

void M68k::OpcodeORI_To_CCR()
{
	word imm = Genesis::M68KReadMemoryWORD(get().programCounter);

	get().programCounter += 2;

	byte loCCR = (byte)get().CCR;
	byte loImm = (byte)imm;

	loCCR |= loImm;

	get().CCR &= 0xFF00;
	get().CCR |= loCCR;

	get().opcodeClicks += 20;
}

void M68k::OpcodeORI_To_SR()
{
	if(get().superVisorModeActivated)
	{
		word imm = Genesis::M68KReadMemoryWORD(get().programCounter);

		get().programCounter += 2;

		get().CCR |= imm;

		get().opcodeClicks += 20;
	}
	else
	{
		get().RequestInt(INT_PRIV_VIO, Genesis::M68KReadMemoryLONG(0x20));
		get().opcodeClicks += 34;
	}
}

void M68k::OpcodePEA(word opcode)
{
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	EA_DATA data = get().GetEAOperand(type, eaReg, LONG, false, 0);

	get().programCounter += data.PCadvance;

	get().registerAddress[0x7] -= 4;

	Genesis::M68KWriteMemoryLONG(get().registerAddress[0x7], data.pointer);

	switch(data.eatype)
	{
		case EA_ADDRESS_REG_INDIRECT:
		get().opcodeClicks += 12;
		break;

		case EA_ADDRESS_REG_INDIRECT_DISPLACEMENT:
		get().opcodeClicks += 16;
		break;

		case EA_ADDRESS_REG_INDIRECT_INDEX:
		get().opcodeClicks += 20;
		break;
	}

	switch(data.mode7Type)
	{
		case EA_MODE_7_ABS_ADDRESS_WORD:
		get().opcodeClicks += 16;
		break;

		case EA_MODE_7_ABS_ADDRESS_LONG:
		get().opcodeClicks += 20;
		break;

		case EA_MODE_7_PC_WITH_DISPLACEMENT:
		get().opcodeClicks += 16;
		break;

		case EA_MODE_7_PC_WITH_PREINDEX:
		get().opcodeClicks += 20;
		break;
	}
}

void M68k::OpcodeRESET()
{
	get().Init();

	get().opcodeClicks += 132;
}

void M68k::OpcodeROL_ROR_Register(word opcode)
{
	byte count_reg = (opcode >> 9) & 0x7;
	byte dr = (opcode >> 8) & 0x1;
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte ir = (opcode >> 5) & 0x1;
	byte reg = opcode & 0x7;

	int rot = 0;

	if(ir == 0)
	{
		rot = (count_reg == 0) ? 8 : count_reg;
	}
	else
	{
		rot = get().registerData[count_reg] % 64;
	}

	int bits = 0;
	switch(size)
	{
		case BYTE:
		bits = 8;
		get().opcodeClicks += (6 + (2 * rot));
		break;

		case WORD:
		bits = 16;
		get().opcodeClicks += (6 + (2 * rot));
		break;

		case LONG:
		bits = 32;
		get().opcodeClicks += (8 + (2 * rot));
		break;
	}

	dword newData = 0;

	if(dr == 0) //rot right
	{
		switch(size)
		{
			case BYTE:
			newData |= ROR((byte)(get().registerData[reg] & 0xFF), rot);
			break;

			case WORD:
			newData |= ROR((word)(get().registerData[reg] & 0xFFFF), rot);
			break;

			case LONG:
			newData |= ROR((dword)(get().registerData[reg] & 0xFFFFFFFF), rot);
			break;
		}

		if(TestBit(newData, bits - 1))
		{
			BitSet(get().CCR, C_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
		}
		
	}
	else //rot left
	{
		switch(size)
		{
			case BYTE:
			newData |= ROL((byte)(get().registerData[reg] & 0xFF), rot);
			break;

			case WORD:
			newData |= ROL((word)(get().registerData[reg] & 0xFFFF), rot);
			break;

			case LONG:
			newData |= ROL((dword)(get().registerData[reg] & 0xFFFFFFFF), rot);
			break;
		}

		if(TestBit(newData, 0))
		{
			BitSet(get().CCR, C_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
		}
	}

	get().SetDataRegister(reg, newData, size);
	
	BitReset(get().CCR, V_FLAG);

	dword vectorman = newData;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}
}

void M68k::OpcodeROL_ROR_Memory(word opcode)
{
	byte dr = (opcode >> 8) & 0x1;
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	int bits = 16;

	EA_DATA dest = get().GetEAOperand(type, eaReg, WORD, true, 0);

	dword toRot = 1;

	dword newData = 0;

	if(dr == 0) //rot right
	{
		
		newData |= ROR((word)(dest.operand & 0xFFFF), toRot);

		if(TestBit(newData, bits - 1))
		{
			BitSet(get().CCR, C_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
		}
	}
	else //rot left
	{
		
		newData |= ROL((word)(dest.operand & 0xFFFF), toRot);

		if(TestBit(toRot, 0))
		{
			BitSet(get().CCR, C_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
		}
	}

	get().SetEAOperand(type, eaReg, newData, WORD, 0);

	BitReset(get().CCR, V_FLAG);

	dword vectorman = newData;
	
	vectorman &= 0xFFFF;

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	if(TestBit(vectorman, 15))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}

	get().programCounter += dest.PCadvance;

	get().opcodeClicks += 8;
	get().opcodeClicks += dest.cycles;
}

void M68k::OpcodeROXL_ROXR_Register(word opcode)
{
	byte count_reg = (opcode >> 9) & 0x7;
	byte dr = (opcode >> 8) & 0x1;
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte ir = (opcode >> 5) & 0x1;
	byte reg = opcode & 0x7;

	int rot = 0;

	if(ir == 0)
	{
		rot = (count_reg == 0) ? 8 : count_reg;
	}
	else
	{
		rot = get().registerData[count_reg] % 64;
	}

	dword toRot = get().registerData[reg];

	int bits = 0;
	switch(size)
	{
		case BYTE:
		bits = 8;
		toRot &= 0xFF;
		get().opcodeClicks += (6 + (2 * rot));
		break;

		case WORD:
		bits = 16;
		toRot &= 0xFFFF;
		get().opcodeClicks += (6 + (2 * rot));
		break;

		case LONG:
		bits = 32;
		get().opcodeClicks += (8 + (2 * rot));
		break;
	}

	dword newData = 0;

	if(dr == 0) //rot right
	{
		for(int i = 0; i < rot; ++i)
		{
			newData = toRot >> 1;

			if(TestBit(get().CCR, X_FLAG))
			{
				BitSet(newData, bits - 1);
			}
			else
			{
				BitReset(newData, bits - 1);
			}

			if(TestBit(toRot, 0))
			{
				BitSet(get().CCR, C_FLAG);
				BitSet(get().CCR, X_FLAG);
			}
			else
			{
				BitReset(get().CCR, C_FLAG);
				BitReset(get().CCR, X_FLAG);
			}
		}
	}
	else //rot left
	{
		for(int i = 0; i < rot; ++i)
		{
			newData = toRot << 1;

			if(TestBit(get().CCR, X_FLAG))
			{
				BitSet(newData, 0);
			}
			else
			{
				BitReset(newData, 0);
			}

			if(TestBit(toRot, bits - 1))
			{
				BitSet(get().CCR, C_FLAG);
				BitSet(get().CCR, X_FLAG);
			}
			else
			{
				BitReset(get().CCR, C_FLAG);
				BitReset(get().CCR, X_FLAG);
			}
		}
	}

	SetDataRegister(reg, newData, size);
	
	BitReset(get().CCR, V_FLAG);

	dword vectorman = newData;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}
}

void M68k::OpcodeROXL_ROXR_Memory(word opcode)
{
	byte dr = (opcode >> 8) & 0x1;
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	int bits = 16;

	EA_DATA dest = get().GetEAOperand(type, eaReg, WORD, true, 0);

	dword toRot = dest.operand;

	dword newData = 0;

	if(dr == 0) //rot right
	{
		newData = toRot >> 1;

		if(TestBit(get().CCR, X_FLAG))
		{
			BitSet(newData, bits - 1);
		}
		else
		{
			BitReset(newData, bits - 1);
		}

		if(TestBit(toRot, 0))
		{
			BitSet(get().CCR, C_FLAG);
			BitSet(get().CCR, X_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
			BitReset(get().CCR, X_FLAG);
		}
	}
	else //rot left
	{
		newData = toRot << 1;

		if(TestBit(get().CCR, X_FLAG))
		{
			BitSet(newData, 0);
		}
		else
		{
			BitReset(newData, 0);
		}

		if(TestBit(toRot, bits - 1))
		{
			BitSet(get().CCR, C_FLAG);
			BitSet(get().CCR, X_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
			BitReset(get().CCR, X_FLAG);
		}
	}

	get().SetEAOperand(type, eaReg, newData, WORD, 0);

	BitReset(get().CCR, V_FLAG);

	dword vectorman = newData;
	
	vectorman &= 0xFFFF;

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	if(TestBit(vectorman, 15))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}

	get().programCounter += dest.PCadvance;

	get().opcodeClicks += 8;
	get().opcodeClicks += dest.cycles;
}

void M68k::OpcodeRTE()
{
	if(get().superVisorModeActivated)
	{
		get().CCR = Genesis::M68KReadMemoryWORD(get().registerAddress[0x7]);
		get().registerAddress[0x7] += 2;
		get().programCounter = Genesis::M68KReadMemoryLONG(get().registerAddress[0x7]);
		get().registerAddress[0x7] += 4;
		get().servicingInt = false;

		get().opcodeClicks += 20;
	}
	else
	{
		get().RequestInt(INT_PRIV_VIO, Genesis::M68KReadMemoryLONG(0x20));

		get().opcodeClicks += 34;
	}
}

void M68k::OpcodeRTR()
{
	word newCCR = Genesis::M68KReadMemoryWORD(get().registerAddress[0x7]);

	get().CCR &= 0xFF00; //Supervisor status conservé
	get().CCR |= (byte)(newCCR & 0xFF);
	get().registerAddress[0x7] += 2;
	get().programCounter = Genesis::M68KReadMemoryLONG(get().registerAddress[0x7]);
	get().registerAddress[0x7] += 4;

	get().opcodeClicks += 20;
}

void M68k::OpcodeRTS()
{
	get().programCounter = Genesis::M68KReadMemoryLONG(get().registerAddress[0x7]);
	get().registerAddress[0x7] += 4;

	get().opcodeClicks += 16;
}

void M68k::OpcodeSBCD(word opcode)
{
	byte ry = (opcode >> 9) & 0x7;
	byte rm = (opcode >> 3) & 0x1;
	byte rx = opcode & 0x7;

	byte src;
	byte dest;

	EA_TYPES type;

	if(rm)
	{
		type = EA_ADDRESS_REG_INDIRECT_PRE_DEC;
	}
	else
	{
		type = EA_DATA_REG;
	}

	
	dest = (byte)get().GetEAOperand(type, ry, BYTE, true, 0).operand;
	src = (byte)get().GetEAOperand(type, rx, BYTE, false, 0).operand;
	

	byte xflag = TestBit(get().CCR, X_FLAG);

	src += xflag;


	byte newSub;
	byte result;

	if(dest < src)
	{
		if(src != 0)
		{
			src--;
		}

		newSub = src - dest;

		result = 0x99 - newSub;

		//BCD OVERFLOW CORRECTION
		if((0x9 - (newSub & 0xF)) < 0x0)
		{
			result -= 0x6;
		}

		if((result >> 4) > 0x9)
		{
			result -= 0x60;
		}

		BitSet(get().CCR, C_FLAG);
		BitSet(get().CCR, X_FLAG);
	}
	else
	{
		result = dest - src;

		//BCD OVERFLOW CORRECTION
		if(((dest & 0xF) - (src & 0xF)) < 0x0)
		{
			result -= 0x6;
		}

		if((result >> 4) > 0x9)
		{
			result -= 0x60;
		}

		BitReset(get().CCR, C_FLAG);
		BitReset(get().CCR, X_FLAG);
	}

	if((result & 0xFF) != 0)
	{
		BitReset(get().CCR, Z_FLAG);
	}

	
	EA_DATA data = get().SetEAOperand(type, ry, (byte)result, BYTE, 0);
	
	if(rm)
	{
		get().opcodeClicks += 18;
		get().opcodeClicks += data.cycles;
	}
	else
	{
		get().opcodeClicks += 6;
	}
}

void M68k::OpcodeScc(word opcode)
{
	byte condition = (opcode >> 8) & 0xF;
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = (opcode & 0x7);

	EA_TYPES type = (EA_TYPES)eaMode;

	byte data = 0;
	if(get().ConditionTable(condition))
	{
		data = 0xFF;
	}

	EA_DATA set = get().SetEAOperand(type, eaReg, data, BYTE, 0);
	get().programCounter += set.PCadvance;

	switch(type)
	{
		case EA_DATA_REG:
		case EA_ADDRESS_REG:
		get().opcodeClicks += (data == 0xFF) ? 6 : 4;
		break;

		default:
		get().opcodeClicks += 8;
		break;
	}
}

void M68k::OpcodeSTOP()
{
	if(get().superVisorModeActivated)
	{
		get().CCR = Genesis::M68KReadMemoryWORD(get().programCounter);
		get().programCounter += 4;
		get().stop = true;

		get().opcodeClicks += 4;
	}
	else
	{
		get().RequestInt(INT_PRIV_VIO, Genesis::M68KReadMemoryLONG(0x20));

		get().opcodeClicks += 34;
	}
}

void M68k::OpcodeSUB(word opcode)
{

	byte reg = (opcode >> 9) & 0x7;
	byte opmode = (opcode >> 6) & 0x7;
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	if(!TestBit(opmode, 2))
	{
		//DN - <EA> -> DN
		DATASIZE size = LONG;
		switch(opmode)
		{
			case 0:
			size = BYTE;
			break;

			case 1:
			size = WORD;
			break;

			case 2:
			size = LONG;
			break;
		}

		EA_TYPES type = (EA_TYPES)eaMode;

		EA_DATA src = get().GetEAOperand(type, eaReg, size, false, 0);
		EA_DATA dest = get().GetEAOperand(EA_DATA_REG, reg, size, true, 0);

		switch(size)
		{
			case BYTE:
			case WORD:
			get().opcodeClicks += 4;
			break;

			case LONG:
			{
				if(src.eatype == EA_DATA_REG || src.eatype == EA_ADDRESS_REG || src.mode7Type == EA_MODE_7_IMMEDIATE)
				{
					get().opcodeClicks += 8;
				}
				else
				{
					get().opcodeClicks += 6;
				}
			}
			break;
		}

		//C_FLAG & X_FLAG
		uint64_t maxTypeSize = get().GetTypeMaxSize(size);
		uint64_t sonic = (uint64_t)dest.operand & maxTypeSize;
		uint64_t tails = (uint64_t)src.operand & maxTypeSize;
		if(sonic < tails)
		{
			BitSet(get().CCR, C_FLAG);
			BitSet(get().CCR, X_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
			BitReset(get().CCR, X_FLAG);
		}

		//V_FLAG
		switch(size)
		{
			case BYTE:
			{
				signed_word eggman = (signed_byte)dest.operand - (signed_byte)src.operand;

				if(eggman < INT8_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;

			case WORD:
			{
				signed_dword eggman = (signed_word)dest.operand - (signed_word)src.operand;

				if(eggman < INT16_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;

			case LONG:
			{
				int64_t eggman = (signed_dword)dest.operand - (signed_dword)src.operand;

				if(eggman < INT32_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;
		}
		dword result = dest.operand - src.operand;
		dword vectorman = result;
		switch(size)
		{
			case BYTE:
			vectorman &= 0xFF;
			break;

			case WORD:
			vectorman &= 0xFFFF;
			break;

			case LONG:
			vectorman &= 0xFFFFFFFF;
			break;
		}

		//Z_FLAG
		if((vectorman) == 0)
		{
			BitSet(get().CCR, Z_FLAG);
		}
		else
		{
			BitReset(get().CCR, Z_FLAG);
		}

		//N_FLAG
		int bit = 0;

		switch(size)
		{
			case BYTE:
			bit = 7;
			break;

			case WORD:
			bit = 15;
			break;

			case LONG:
			bit = 31;
			break;
		}

		if(TestBit(vectorman, bit))
		{
			BitSet(get().CCR, N_FLAG);
		}
		else
		{
			BitReset(get().CCR, N_FLAG);
		}

		get().SetEAOperand(EA_DATA_REG, reg, result, size, 0);

		get().programCounter += src.PCadvance;

		get().opcodeClicks += src.cycles;

	}
	else
	{
		//<EA> - DN -> <EA>
		DATASIZE size = LONG;
		switch(opmode)
		{
			case 4:
			size = BYTE;
			break;

			case 5:
			size = WORD;
			break;

			case 6:
			size = LONG;
			break;
		}

		EA_TYPES type = (EA_TYPES)eaMode;

		EA_DATA src = get().GetEAOperand(EA_DATA_REG, reg, size, true, 0);
		EA_DATA dest = get().GetEAOperand(type, eaReg, size, false, 0);

		if(size == WORD && type == EA_ADDRESS_REG)
		{
			switch(size)
			{
				case BYTE:
				case WORD:
				get().opcodeClicks += 8;
				break;

				case LONG:
				{
					if(src.eatype == EA_DATA_REG || src.eatype == EA_ADDRESS_REG || src.mode7Type == EA_MODE_7_IMMEDIATE)
					{
						get().opcodeClicks += 8;
					}
					else
					{
						get().opcodeClicks += 6;
					}
				}
				break;
			}
		}
		else
		{
			switch(size)
			{
				case BYTE:
				case WORD:
				get().opcodeClicks += 8;
				break;

				case LONG:
				get().opcodeClicks += 12;
				break;
			}
		}
		
		dword result = dest.operand - src.operand;
		
		if(size == WORD && type == EA_ADDRESS_REG)
		{
			result = get().SignExtendDWord((word)dest.operand) - get().SignExtendDWord((word)src.operand);
			size = LONG;
		}

		//C_FLAG & X_FLAG
		uint64_t maxTypeSize = get().GetTypeMaxSize(size);
		uint64_t sonic = (uint64_t)dest.operand & maxTypeSize;
		uint64_t tails = (uint64_t)src.operand & maxTypeSize;
		if(sonic < tails)
		{
			BitSet(get().CCR, C_FLAG);
			BitSet(get().CCR, X_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
			BitReset(get().CCR, X_FLAG);
		}

		//V_FLAG
		switch(size)
		{
			case BYTE:
			{
				signed_word eggman = (signed_byte)dest.operand - (signed_byte)src.operand;

				if(eggman < INT8_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;

			case WORD:
			{
				signed_dword eggman = (signed_word)dest.operand - (signed_word)src.operand;

				if(eggman < INT16_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;

			case LONG:
			{
				int64_t eggman = (signed_dword)dest.operand - (signed_dword)src.operand;

				if(eggman < INT32_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;
		}

		dword vectorman = result;
		switch(size)
		{
			case BYTE:
			vectorman &= 0xFF;
			break;

			case WORD:
			vectorman &= 0xFFFF;
			break;

			case LONG:
			vectorman &= 0xFFFFFFFF;
			break;
		}

		//Z_FLAG
		if((vectorman) == 0)
		{
			BitSet(get().CCR, Z_FLAG);
		}
		else
		{
			BitReset(get().CCR, Z_FLAG);
		}

		//N_FLAG
		int bit = 0;

		switch(size)
		{
			case BYTE:
			bit = 7;
			break;

			case WORD:
			bit = 15;
			break;

			case LONG:
			bit = 31;
			break;
		}

		if(TestBit(vectorman, bit))
		{
			BitSet(get().CCR, N_FLAG);
		}
		else
		{
			BitReset(get().CCR, N_FLAG);
		}

		get().SetEAOperand(type, eaReg, result, size, 0);

		get().programCounter += dest.PCadvance;
		get().opcodeClicks += dest.cycles;
	}
}

void M68k::OpcodeSUBA(word opcode)
{
	byte reg = (opcode >> 9) & 0x7;
	byte opmode = (opcode >> 6) & 0x7;
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	DATASIZE size = LONG;
	switch(opmode)
	{
		case 3:
		size = WORD;
		break;

		case 7:
		size = LONG;
		break;
	}

	EA_TYPES type = (EA_TYPES)eaMode;

	EA_DATA data = get().GetEAOperand(type, eaReg, size, false, 0);

	switch(size)
	{
		case BYTE:
		case WORD:
		get().opcodeClicks += 8;
		break;

		case LONG:
		{
			if(data.eatype == EA_DATA_REG || data.eatype == EA_ADDRESS_REG || data.mode7Type == EA_MODE_7_IMMEDIATE)
			{
				get().opcodeClicks += 8;
			}
			else
			{
				get().opcodeClicks += 6;
			}
		}
	}

	dword result = get().registerAddress[reg] - data.operand;

	SetAddressRegister(reg, result, size);

	get().programCounter += data.PCadvance;

	get().opcodeClicks += data.cycles;
}

void M68k::OpcodeSUBI(word opcode)
{
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);

	byte eaMode = (opcode >> 3) & 0x7;

	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	EA_DATA src = get().GetEAOperand(EA_MODE_7, EA_MODE_7_IMMEDIATE, size, false, 0);
	get().programCounter += src.PCadvance;
	EA_DATA dest = get().GetEAOperand(type, eaReg, size, true, 0);

	if(type == EA_DATA_REG || type == EA_ADDRESS_REG)
	{
		get().opcodeClicks += (size == LONG) ? 16 : 8;
	}
	else
	{
		get().opcodeClicks += (size == LONG) ? 20 : 12;
	}

	get().opcodeClicks += dest.cycles;

	//C_FLAG & X_FLAG
	uint64_t maxTypeSize = get().GetTypeMaxSize(size);
	uint64_t sonic = (uint64_t)dest.operand & maxTypeSize;
	uint64_t tails = (uint64_t)src.operand & maxTypeSize;
	if(sonic < tails)
	{
		BitSet(get().CCR, C_FLAG);
		BitSet(get().CCR, X_FLAG);
	}
	else
	{
		BitReset(get().CCR, C_FLAG);
		BitReset(get().CCR, X_FLAG);
	}

	//V_FLAG
	switch(size)
	{
		case BYTE:
		{
			signed_word eggman = (signed_byte)dest.operand - (signed_byte)src.operand;

			if(eggman < INT8_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;

		case WORD:
		{
			signed_dword eggman = (signed_word)dest.operand - (signed_word)src.operand;

			if(eggman < INT16_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;

		case LONG:
		{
			int64_t eggman = (signed_dword)dest.operand - (signed_dword)src.operand;

			if(eggman < INT32_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;
	}

	dword result = dest.operand - src.operand;

	dword vectorman = result;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if(vectorman == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}

	get().SetEAOperand(type, eaReg, result, size, 0);

	get().programCounter += dest.PCadvance;
}

void M68k::OpcodeSUBQ(word opcode)
{
	byte data = (opcode >> 9) & 0x7;
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	dword sub = (data == 0) ? 8 : data;

	bool signExtend = (type == EA_ADDRESS_REG && size == WORD);

	if(signExtend)
	{
		sub = get().SignExtendDWord((word)sub);
	}

	EA_DATA dest = get().GetEAOperand(type, eaReg, size, true, 0);

	dword result = dest.operand - sub;

	get().SetEAOperand(type, eaReg, result, size, 0);

	if(type == EA_DATA_REG)
	{
		get().opcodeClicks += (size == LONG) ? 8 : 4;
	}
	else if(type == EA_ADDRESS_REG)
	{
		get().opcodeClicks += (size == BYTE) ? 4 : 8; 
	}
	else
	{
		get().opcodeClicks += (size == LONG) ? 12 : 8;
	}

	get().opcodeClicks += dest.cycles;

	if(signExtend)
	{
		size = LONG;
	}

	if(type != EA_ADDRESS_REG)
	{
		//C_FLAG & X_FLAG
		uint64_t maxTypeSize = get().GetTypeMaxSize(size);
		uint64_t sonic = (uint64_t)dest.operand & maxTypeSize;
		uint64_t tails = (uint64_t)sub & maxTypeSize;
		if(sonic < tails)
		{
			BitSet(get().CCR, C_FLAG);
			BitSet(get().CCR, X_FLAG);
		}
		else
		{
			BitReset(get().CCR, C_FLAG);
			BitReset(get().CCR, X_FLAG);
		}

		//V_FLAG
		switch(size)
		{
			case BYTE:
			{
				signed_word eggman = (signed_byte)dest.operand - (signed_byte)sub;

				if(eggman < INT8_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;

			case WORD:
			{
				signed_dword eggman = (signed_word)dest.operand - (signed_word)sub;

				if(eggman < INT16_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;

			case LONG:
			{
				int64_t eggman = (signed_dword)dest.operand - (signed_dword)sub;

				if(eggman < INT32_MIN)
				{
					BitSet(get().CCR, V_FLAG);
				}
				else
				{
					BitReset(get().CCR, V_FLAG);
				}
			}
			break;
		}

		dword vectorman = result;
		switch(size)
		{
			case BYTE:
			vectorman &= 0xFF;
			break;

			case WORD:
			vectorman &= 0xFFFF;
			break;

			case LONG:
			vectorman &= 0xFFFFFFFF;
			break;
		}

		//Z_FLAG
		if((vectorman) == 0)
		{
			BitSet(get().CCR, Z_FLAG);
		}
		else
		{
			BitReset(get().CCR, Z_FLAG);
		}

		//N_FLAG
		int bit = 0;

		switch(size)
		{
			case BYTE:
			bit = 7;
			break;

			case WORD:
			bit = 15;
			break;

			case LONG:
			bit = 31;
			break;
		}

		if(TestBit(vectorman, bit))
		{
			BitSet(get().CCR, N_FLAG);
		}
		else
		{
			BitReset(get().CCR, N_FLAG);
		}
	}	

	get().programCounter += dest.PCadvance;
}

void M68k::OpcodeSUBX(word opcode)
{
	byte ry = (opcode >> 9) & 0x7;
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte rm = (opcode >> 3) & 0x1;
	byte rx = opcode & 0x7;

	dword xflag = TestBit(get().CCR, X_FLAG);

	EA_TYPES type;

	if(rm)
	{
		type = EA_ADDRESS_REG_INDIRECT_PRE_DEC;
		get().opcodeClicks += (size == LONG) ? 30 : 18;
	}
	else
	{
		type = EA_DATA_REG;
		get().opcodeClicks += (size == LONG) ? 8 : 4;
	}

	
	EA_DATA dest = get().GetEAOperand(type, ry, BYTE, true, 0);
	EA_DATA src = get().GetEAOperand(type, rx, BYTE, false, 0);

	//C_FLAG & X_FLAG
	uint64_t maxTypeSize = get().GetTypeMaxSize(size);
	uint64_t sonic = (uint64_t)dest.operand & maxTypeSize;
	uint64_t tails = (uint64_t)((src.operand + xflag) & maxTypeSize);
	if(sonic < tails)
	{
		BitSet(get().CCR, C_FLAG);
		BitSet(get().CCR, X_FLAG);
	}
	else
	{
		BitReset(get().CCR, C_FLAG);
		BitReset(get().CCR, X_FLAG);
	}

	//V_FLAG
	switch(size)
	{
		case BYTE:
		{
			signed_word eggman = (signed_byte)dest.operand - (signed_byte)src.operand - (signed_byte)xflag;

			if(eggman < INT8_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;

		case WORD:
		{
			signed_dword eggman = (signed_word)dest.operand - (signed_word)src.operand - (signed_word)xflag;

			if(eggman < INT16_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;

		case LONG:
		{
			int64_t eggman = (signed_dword)dest.operand - (signed_dword)src.operand - (signed_dword)xflag;

			if(eggman < INT32_MIN)
			{
				BitSet(get().CCR, V_FLAG);
			}
			else
			{
				BitReset(get().CCR, V_FLAG);
			}
		}
		break;
	}

	dword result = dest.operand - src.operand - xflag;

	dword vectorman = result;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if(vectorman != 0)
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}

	get().SetEAOperand(type, ry, result, size, 0);
}

void M68k::OpcodeSWAP(word opcode)
{
	byte reg = opcode & 0x7;

	dword data = get().registerData[reg];
	word lo = (word)(data & 0xFFFF);
	word hi = (word)((data >> 16) & 0xFFFF);
	dword newData = ((dword)lo << 16) | hi;

	get().registerData[reg] = newData;

	BitReset(get().CCR, C_FLAG);
	BitReset(get().CCR, V_FLAG);

	if(newData == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	if(TestBit(newData, 31))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}

	get().opcodeClicks += 4;
}

void M68k::OpcodeTAS(word opcode)
{
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	EA_DATA data = get().GetEAOperand(type, eaReg, BYTE, false, 0);

	BitReset(get().CCR, C_FLAG);
	BitReset(get().CCR, V_FLAG);

	dword vectorman = data.operand;
	
	vectorman &= 0xFF;	

	//Z_FLAG
	if((vectorman) == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG

	if(TestBit(vectorman, 7))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}

	BitSet(data.operand, 7);

	get().programCounter += data.PCadvance;

	if(type == EA_ADDRESS_REG || type == EA_DATA_REG)
	{
		get().opcodeClicks += 4;
	}
	else
	{
		get().opcodeClicks += 10;
	}

}

void M68k::OpcodeTRAP(word opcode)
{
	byte vector = opcode & 0xF;

	get().RequestInt(INT_TRAP, Genesis::M68KReadMemoryLONG((32 + vector) * 4));

	get().opcodeClicks += 38;
}

void M68k::OpcodeTRAPV()
{
	if(TestBit(get().CCR, V_FLAG))
	{
		get().OpcodeTRAP(4);
	}

	get().opcodeClicks += 4;
}

void M68k::OpcodeTST(word opcode)
{
	DATASIZE size = (DATASIZE)((opcode >> 6) & 0x3);
	byte eaMode = (opcode >> 3) & 0x7;
	byte eaReg = opcode & 0x7;

	EA_TYPES type = (EA_TYPES)eaMode;

	EA_DATA dest = get().GetEAOperand(type, eaReg, size, false, 0);

	BitReset(get().CCR, C_FLAG);
	BitReset(get().CCR, V_FLAG);

	dword vectorman = dest.operand;
	switch(size)
	{
		case BYTE:
		vectorman &= 0xFF;
		break;

		case WORD:
		vectorman &= 0xFFFF;
		break;

		case LONG:
		vectorman &= 0xFFFFFFFF;
		break;
	}

	//Z_FLAG
	if(vectorman == 0)
	{
		BitSet(get().CCR, Z_FLAG);
	}
	else
	{
		BitReset(get().CCR, Z_FLAG);
	}

	//N_FLAG
	int bit = 0;

	switch(size)
	{
		case BYTE:
		bit = 7;
		break;

		case WORD:
		bit = 15;
		break;

		case LONG:
		bit = 31;
		break;
	}

	if(TestBit(vectorman, bit))
	{
		BitSet(get().CCR, N_FLAG);
	}
	else
	{
		BitReset(get().CCR, N_FLAG);
	}

	get().programCounter += dest.PCadvance;

	get().opcodeClicks += 4;
	get().opcodeClicks += dest.cycles;
}

void M68k::OpcodeUNLK(word opcode)
{
	byte reg = opcode & 0x7;

	get().registerAddress[0x7] = get().registerAddress[reg];
	get().registerAddress[reg] = Genesis::M68KReadMemoryLONG(get().registerAddress[0x7]);
	get().registerAddress[0x7] += 4;

	get().opcodeClicks += 12;
}